import {WidgetConfig} from "./widget-config.model";
import {HttpClient} from "@angular/common/http";
import {Injectable} from "@angular/core";

@Injectable()
export class AppConfig {
  static settings: WidgetConfig;
  constructor(private http: HttpClient) {}
  load() {
    const jsonFile = 'assets/widget-config.json';
    return new Promise<void>((resolve, reject) => {
      this.http.get(jsonFile).toPromise().then(response => {
        AppConfig.settings = <WidgetConfig>response;
        resolve();
      }).catch((response: any) => {
        reject(`Could not load file '${jsonFile}': ${JSON.stringify(response)}`);
      });
    });
  }
}

import { Injectable } from '@angular/core';
import {environment} from "../../../../environments/environment";
import {HttpClient} from "@angular/common/http";

@Injectable({
  providedIn: 'root'
})
export class StockService {

  private api = `https://rest.yahoofinanceapi.com`;

  constructor(
    private http: HttpClient
  ) { }

  getSpark(symbols: string, interval = '1d', range = '1mo') {
    return this.http.get(
      `${this.api}/v8/finance/spark`,
      {
        headers: {
          'x-api-key': environment.yahooApiKey
        },
        params: {
          symbols: symbols,
          interval: interval,
          range: range
        }
      });
  }
}

